import { createSlice } from "@reduxjs/toolkit";
const selectProdactSlice = createSlice({
    name: "selectProduct",
    initialState: {son:19},
    reducers: {
        setSelectorProdact: () => {
            console.log("aa")
        }
    }
})
export const { setSelectorProdact } = selectProdactSlice.actions;
export default selectProdactSlice.reducers;
